import React from 'react';
import { Link } from "@reach/router";

let textImage = {
  imageUrl:"https://res.cloudinary.com/glide/image/fetch/f_auto,w_300,h_300,c_lfill/https%3A%2F%2Ffirebasestorage.googleapis.com%2Fv0%2Fb%2Fglide-prod.appspot.com%2Fo%2Ficon-images%252Fanonymous-e7fcf338-8a49-44d2-9fcb-afd802a823c8.png%3Falt%3Dmedia%26token%3D161e099a-1f69-426e-8633-ca4f70b80502",
  imageText:"image2 and stuff - Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec pellentesque quam leo, at tincidunt odio pretium eu. Sed rhoncus rhoncus fermentum. Nunc sodales iaculis odio molestie sagittis. Donec dictum ante nec tempus varius. Proin sodales efficitur justo non commodo. Nulla nec odio quis tellus porttitor mattis ultrices eget diam. Donec ultricies vel justo at vulputate.",
  }

  function Picture2 ({imageUrl, imageText}) {
    return(
  <div className="img-text">
  <img src={textImage.imageUrl}  alt=""/>
  <p >{textImage.imageText}</p>

      <ul>
      <li><Link to="/gallery">GO BACK</Link></li>
    </ul>
</div>


  );
}


export default Picture2;
